content=A cloud was on the mind of men, and wailing went the weather, / Yea, a sick cloud upon the soul when we were boys together. / Science announced nonentity and art admired decay; / The world was old and ended: but you and I were gay; / Round us in antic order their crippled vices came -- / Lust that had lost its laughter, fear that had lost its shame. / Like the white lock of Whistler, that lit our aimless gloom, / Men showed their own white feather as proudly as a plume.

